CREATE TABLE big_buy_history_with_focus (trade_name varchar(32), trade_id bigint NOT NULL, ts_code varchar(32), trade_date varchar(32) NOT NULL, focus_0 bigint, rank_focus_0 bigint, return_10 float, return_30 float, return_60 float, macd_num float, high_time bigint, rzrq bigint, score float, rank_score bigint, buy_benefit float, remark varchar(200), PRIMARY KEY (trade_id, trade_date)) ENGINE=InnoDB DEFAULT CHARSET=utf8;
